import { Button, TextInput,Card } from "@mantine/core";
import React from "react";
import { login } from "../pages/actions";
import { useDispatch } from "react-redux";
import { useNavigate} from "react-router-dom";
import './comp.css'
function Login()
{
    const dispatch=useDispatch()
    const navigate=useNavigate()
    return(
    <div id='login_back'>
        <Card id='login'>
            <center><h1>Login Page</h1></center>
            <TextInput className="login_comp" placeholder="username/email" label='Username'/>
            <TextInput className="login_comp" placeholder="password" label='Password'/>
            <center><Button className='login_comp' onClick={()=>{
                                     dispatch(login())
                                    navigate('/home')
                                }}>Sign in</Button>
            <br/>
            <a style={{fontSize:12,cursor:"pointer"}}>Not registered yet?</a></center>
        </Card>
    </div>
    )
}

export default Login;
